import React from 'react';
import logo from './logo.svg';
import './App.css';
import { BrowserRouter, Route, Link, NavLink } from 'react-router-dom';
import Landing from './Landing.js';
import Design from './Design.js';
import Illustration from './Illustration.js';
import About from './About.js';

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <Route path="/" component={Landing} />
        <Route path="/design" component={Design} />
        <Route path="/illustration" component={Illustration} />
        <Route path="/about" component={About} />

        <div className="navigation">
          <ul>
          <li><NavLink to="/" className="item" activeStyle={{color: "#222222"}} >Home</NavLink></li>
          <li><NavLink to="/design" className="item" activeStyle={{color: "#222222"}} >Design</NavLink></li>
          <li><NavLink to="/illustration" className="item" activeStyle={{color: "#222222"}} >Illustration</NavLink></li>
          <li><NavLink to="/about" className="item" activeStyle={{color: "#415f77"}} >About</NavLink></li>
          </ul>
        </div>
      </div>
    </BrowserRouter>
  );
}

export default App;
